import { useEffect } from "react";
import { NextPage } from "next";

import HomeModuleList from "../components/HomeModuleList";
import SectionTitle from "../components/SectionTitle";
import ModuleCompareModal from "../components/ModuleCompareModal";
import axios from "axios";

const Home: NextPage = ({ }) => {

  // Mock Login API call
  useEffect(() => {
    axios.post("http://localhost:8080/api/login", {
      email: "wvYtiJ5XKUi6QaEUpp@email.edu",
      password: "cb8aff5771ab6e68860f5507937671b836280dbc0eca2fbce83ee7cea3677114:314cac4a67b10f2569852c5e3ec8e2d71809cce2f119ec1d478f1f8c9c8a9c9c19529970ef1b22885bb03cced4a9a02fd49af7a26cd62f2275a848e9fb1ab72b"
    }, {
      withCredentials: true
    }).then(res => {
      console.log("res:", res)
    })
      .catch(err => console.log("err at login:", err))
  }, []);

  return (
    <>
      <ModuleCompareModal />
      <SectionTitle title="Trending Modules" />
      <HomeModuleList />
      <SectionTitle title="Popular Modules" />
      <HomeModuleList />
      <SectionTitle title="Recommended For You" />
      <HomeModuleList />
    </>
  );
};

export default Home;
